import './portfolio.css';
//import Connect4 from './Connect4';
import Projects from './Projects';
import Experience from './Experience';
import { useRef, useEffect } from 'react';
import React from "react";

function Portfolio({setPosition, currPosition}) {
  const projectRef = useRef(null);
  const skillsRef = useRef(null);
  const experienceRef = useRef(null);
  const gamesRef = useRef(null);
  useEffect(() => {
    var newPos = currPosition.slice();
    if (projectRef.current) {
      const rect = projectRef.current.getBoundingClientRect();
      newPos[1] = rect.y;
    }
    if (skillsRef.current) {
      const rect = skillsRef.current.getBoundingClientRect();
      newPos[2] = rect.y;
    }
    if (experienceRef.current) {
      const rect = experienceRef.current.getBoundingClientRect();
      newPos[3] = rect.y;
    }
    if (gamesRef.current) {
      const rect = gamesRef.current.getBoundingClientRect();
      newPos[4] = rect.y;
    }
    setPosition(newPos);
  }, []);  

  return (
    <div className="portfolioSections">
     <Projects elRef={projectRef}/>
     <Skills elRef={skillsRef}/>
     <Experience elRef={experienceRef}/>
     {/* <Games elRef={gamesRef}/> */}
    </div>
  );
}
